import React from "react";
import { Link } from "react-router-dom";
import { Card, Col, Image } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

import "./UserItem.css";

const UserItem = props => {
  console.log(props.image);
  return (
    <Card className="bg-dark text-white">
      {/* <img src="/src/img/profile_picture/julie.jpg" alt={props.title}/> */}
      {/* <img src={`${require("../../img/profile_picture/obama.jpg")}`} alt="ok" /> */}
      <Col xs={6} md={4}>
        <Image src={props.image} roundedCircle width="50" />
      </Col>
      {/* <Card.Img src={props.image} /> */}
      <Card.ImgOverlay>
        <Link to={`/${props.id}/match`}>
          <Card.Title>{props.name}</Card.Title>
        </Link>
        <Card.Body>
          <Card.Link center href="#">
            Like
          </Card.Link>
          <Card.Link href="#">Dislike</Card.Link>
        </Card.Body>
      </Card.ImgOverlay>
    </Card>
  );
};

export default UserItem;
